import React from "react";
import styled from "styled-components";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from "./Header";
import NavBar from "./NavBar";

const Center = styled.div`
    height: 92vh;
    display:flex;
    flex-direction: row;    
`

function ChargeCash(){

    return(
        <div><Router>
            <Header title={"머니충전"} />
            <Center>
                <NavBar />
                <Routes>
                    <Route path="/main">머니 충전</Route>
                    <Route path="/main/payCash">머니 결제</Route>
                    <Route path="/main/payHistory">거래내역</Route>
                </Routes>
                <h1>Hello_World</h1>
            </Center>
        </Router>
        </div>
    );
}

export default ChargeCash;
